window.bookSummaryJSON = "<p><b><i>She stole my birthright, so I’ll claim her by any means possible.</i></b><br> <br> I was banished from my family two years ago by my <i>Pakhan</i> and brother, and any mention of the Belyaevs makes me burn with red-hot anger. I’m no longer heir to the Belyaev crime family fortune.<br> <br> But she is.<br> <br> Zenya Belyaev, the most beautiful girl I’ve ever seen. She’s the mirror of my soul. The second half of my treacherous heart. The key to my future as the most powerful man in the city.<br> <br> Our love is forbidden fruit. Zenya burns from the shame of wanting me, but I will sink my teeth into her heart and make her lick the juice from my lips. She thinks one taste is enough for me after wanting her all these years?<br> <br> Princess, I’m only just getting started.</p> <p><i>Author’s note: </i><b><i>Brutal Conquest</i></b><i> is a stand-alone MF romance with forbidden themes, breeding, an 18-year age gap, a jealous and possessive alphahole uncle (no blood relation), and a sweet but strong virgin heroine. The story is dirty and delicious, so please listen at your discretion.</i></p>"; 
